import { useRef, useState, useCallback, useEffect } from "react";
import Webcam from "react-webcam";
import styled from "styled-components";
import { CameraIcon } from "@heroicons/react/24/outline";
import Check from "./Check";
import { useNavigate } from "react-router-dom";
import { getBookInfoAPI, postBookIdAPI } from "../../apis/isbn";

// const videoConstraints = {
//   width: 360,
//   height: 740,
//   facingMode: "environment",
//   // facingMode: "user",
// };

export const Isbn = () => {
  const navigate = useNavigate();
  const webcamRef = useRef<Webcam>(null);
  const [url, setUrl] = useState<string>("");
  const [title, setTitle] = useState<string>("");
  const [bookId, setBookId] = useState<number>(0);
  const [videoWidth, setVideoWidth] = useState<number>(window.innerWidth);
  const [videoHeight, setVideoHeight] = useState<number>(window.innerHeight);

  useEffect(() => {
    setVideoWidth(window.innerWidth);
    setVideoHeight(window.innerHeight);
  }, []);

  const videoConstraints = {
    width: videoWidth,
    height: videoHeight,
    facingMode: "environment",
    // facingMode: "user",
  };

  const capture = useCallback(() => {
    const imageSrc = webcamRef.current?.getScreenshot();
    if (imageSrc) {
      setUrl(imageSrc);
    }
  }, [webcamRef]);

  const getBookInfo = async (url: string) => {
    const data = await getBookInfoAPI(url);
    setTitle(data.responseData.title);
    setBookId(data.responseData.id);
  };

  useEffect(() => {
    if (url) {
      getBookInfo(imgUrl);
    }
  }, [url]);

  const bookCheck = async () => {
    await postBookIdAPI(bookId);
  };

  const clickNoBtn = () => {
    setTitle("");
  };

  const clickYesBtn = () => {
    bookCheck();
    alert("등록되었습니다.");
    navigate("/");
  };

  return (
    <div>
      {!title ? (
        <Cam>
          <Webcam
            audio={false}
            ref={webcamRef}
            screenshotFormat="image/png"
            videoConstraints={videoConstraints}
          />
          <Barcode>
            <BarcodeBox />
            <BarcodeText>
              도서 바코드를 사각형 안에 맞추고
              <br />
              사진을 찍어 책을 등록하세요!
            </BarcodeText>
          </Barcode>
          <Button onClick={capture}>
            <Camera>
              <CameraIcon
                width="40px"
                strokeWidth="1.5px"
                color="#ffffff"
              ></CameraIcon>
            </Camera>
          </Button>
        </Cam>
      ) : (
        <Check
          title={title}
          clickNoBtn={clickNoBtn}
          clickYesBtn={clickYesBtn}
        />
      )}
    </div>
  );
};

// styled component
const Cam = styled.div`
  width: 100vw;
  height: 100vh;
`;

const Barcode = styled.div`
  z-index: 999;
  display: flex;
  flex-direction: column;
  justify-content: center;
  position: absolute;
  bottom: 40%;
  left: 50%;
  transform: translateX(-50%);
`;

const BarcodeBox = styled.div`
  height: 200px;
  width: 320px;
  border: 4px solid black;
`;

const BarcodeText = styled.div`
  text-align: center;
  font-weight: bold;
  margin-top: 16px;
`;

const Button = styled.div`
  z-index: 999;
  border-radius: 100px;
  height: 80px;
  width: 80px;
  background-color: black;
  top: 83%;
  left: 40%;
  position: fixed;
`;

const Camera = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
`;

const imgUrl: string =
  '"data:image/png;base64,"';
